import React from 'react';
const Footer = () => {
    return ( 
        <>
            <div className="bg-dark text-white footer">
                <a>Contacto</a>
                <a>Ubicacion</a>
                <a>Ayuda</a>
            </div>
        </>
    );
}
 
export default Footer;
